import React from 'react';

export const ChartEntry = (props) => {
  const { chartEntries } = props;
  if (chartEntries !== undefined) {
    return (
        <div>
          { chartEntries && chartEntries.map((entry, index) => {
            return (
                <Link to={'/projectAP/' + entry.AP_name} key={project.AP_name}>
                    <p>{entry.AP_name}</p>
                </Link>
            )
          }) }
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
